import { gql } from "@apollo/client";

export const searchQuery = gql`
  query feed($skip: Int, $first: Int, $keyword: String) {
    getPosts(skip: $skip, first: $first, searchKeyword: $keyword) {
      id
      title
      description
      createdAt
      user {
        id
        nickname
        avatar {
          url
        }
      }
      video {
        url
      }
      likes {
        user {
          id
        }
      }
      status
      room {
        id
      }
    }
    getUsers(skip: $skip, first: $first, nickname: $keyword) {
      id
      nickname
      email
      avatar {
        url
      }
      isMaster
      followedBy {
        id
      }
      following {
        id
      }
      posts {
        id
      }
    }
  }
`;
